import React from 'react';
import {
  FacebookShareButton,
  LinkedinShareButton,
  RedditShareButton,
  TwitterShareButton,
  WhatsappShareButton
} from "react-share"

function App() {
  return (
    <div className="App">
      <div className="header">
        Podcast Ideas
      </div>
      <div className="content">
        <div className="square">
          <h1 style={{
            textAlign:"center"
          }}>Podcast Title</h1>
          <img src="https://source.unsplash.com/random"></img>
          <div>
            <FacebookShareButton></FacebookShareButton>
            <LinkedinShareButton></LinkedinShareButton>
          </div>
        </div>
      </div>
      <div className="footer">
        <button style={{
          height:"100%",
          background:"none",
          border:"none",
          padding:"0",
          fontSize:"25px",
          margin: "10px"
        }}>Next ></button>
      </div>


    </div>
  );
}

export default App;
